window.bookSummaryJSON = "<p><b>WARNING: May Contain Werewolves, Egyptian Gods, and the Truth About Human History</b></p> <p>A pyramid predating all known cultures appears without warning. Its discovery throws into question everything we know about the origins of mankind.</p> <p>Inside lies incredible technology, proof of a culture far more advanced than our own. Something dark lurks within, eager to resume a war as old as mankind. When it is unleashed it heralds the end of our speciesâ€™ reign.</p> <p>A plague of werewolves spreads across the world. A sunspot larger than anything in recorded history begins to grow. Yet both pale in comparison to the true threat, the evil the werewolves were created to fight.</p> <p>\"It's like Indiana Jones went through the Stargate and ended up in Aliens versus Predator.\" (One of the author's totally biased friends)</p> <p><b><i>This complete collection gathers all six books and the prequel novella...everything Deathless all in one bundle!</i></b></p>"; 
